import React from 'react';
import './field.scss'
import Square from "../Square/Square";

const Field = () =>{
    const han = (event) =>{
        let data = event.target.getAttribute('data');
        console.log(data)
    }

    const result = Array(9).fill(null).map((item, index) =>{

        return(
            <Square content={item} onClick={han} data={index} />
        )
    })

    return(
        <div className='field-container'>
            {result}
        </div>
    )

}

export default Field;
